import { useEffect, useState } from "react";
import axios from "axios";

export const QuizzesList = () => {
  const [quizzes, setQuizzes] = useState([]);
  useEffect(() => {
    const fetchQuestions = async () => {
      try {
        const response = await axios.get("http://localhost:4444/quiz/");
        response.data.map(item => setQuizzes([...quizzes, item]))
        setQuizzes([...quizzes, response.data]);
      } catch (err) {
        console.log(err);
      }
    };
    fetchQuestions();
    console.log(quizzes);
  }, []);
  return (
    <>
      <h2>Quizzes List</h2>
    </>
  );
};
